INSERT INTO `table_operatspec` VALUES ('4', '急诊医学', '心肺复苏术', '人工气道', '口咽通气道', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>呼吸肌麻痹或中枢性呼吸衰竭。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>下呼吸道梗阻。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>患者需要进行机械通气。\n', '', , , '', '4.0', '');
INSERT INTO `table_operatspec` VALUES ('5', '急诊医学', '心肺复苏术', '人工气道', '鼻咽通气道', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>怀疑有颅骨骨折的患者。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>下呼吸道梗阻。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>需要进行机械通气者。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>严重的鼻腔疾病导致鼻咽道狭窄患者。\n', '', , , '', '5.0', '');
INSERT INTO `table_operatspec` VALUES ('6', '急诊医学', '心肺复苏术', '人工气道', '喉罩气道', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>因异物或喉头水肿引起的上呼吸道梗阻患者。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>易发生误吸患者。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>存在高度胃内容物反流危险患者。\n', '', , , '', '6.0', '');
INSERT INTO `table_operatspec` VALUES ('7', '急诊医学', '心肺复苏术', '人工气道', '食管气管联合导管', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>年龄小于16岁，身高不足150cm者。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>气道保护反应强烈者。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>食管病变或急性腐蚀性食管炎患者。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>异物或咽喉疾病导致上呼吸道梗阻者。\n', '', , , '', '7.0', '');
INSERT INTO `table_operatspec` VALUES ('8', '急诊医学', '心肺复苏术', '人工气道', '气管插管术', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>部分气管横断的患者直接喉镜下气管插管为相对禁忌证，因为气管插管过程中可导致气管全部横断及气道损伤。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>不稳定颈椎损伤不是禁忌证，但是插管时颈椎必须保持严格的呈线性固定。\n', , , '', , '8.0', 'XFFS8-B1-SQ/XFFS8-B1-CZ/XFFS8-B2-CZ');
INSERT INTO `table_operatspec` VALUES ('9', '急诊医学', '心肺复苏术', '人工气道', '气管切开术', '', , , '', '', , '', '', '9.0', 'XFFS9-B1-CZ');
INSERT INTO `table_operatspec` VALUES ('10', '急诊医学', '心肺复苏术', '人工气道', '经皮微创气管切开术', '', , '', '<p/><font color=\"#4bb033\">1.&nbsp;</font>绝对禁忌证\n<p/>(1)紧急气管手术(在紧急状况下，环甲膜穿刺术优先选择)。\n<p/>(2)儿童。\n<p/>(3)气管切开部位存在感染。\n<p/>(4)气管切开时患者出现严重恶心。\n<p/>(5)解剖标志不能确定。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>相对禁忌证\n<p/>(1)甲状腺增生。\n<p/>(2)切开部位既往已经手术。\n<p/>(3)出血体质(此前抗凝治疗)。\n', , , , '', '10.0', '');
