INSERT INTO `table_operatspec` VALUES ('28', '急诊医学', '心肺复苏术', '静脉通道的建立', '深静脉穿刺血管', '颈内静脉穿刺置管', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>穿刺部位感染和解剖结构不清者禁用。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>血小板明显减少及凝血机制障碍者慎用。\n', '', , , '', '28.0', '');
