INSERT INTO `table_operatspec` VALUES ('32', '急诊医学', '心肺复苏术', '静脉通道的建立', '动脉穿刺插管术', '', '', , '<p/><font color=\"#4bb033\">1.&nbsp;</font>有出血倾向。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>穿刺局部有感染。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>桡动脉穿刺前应进行Allen试验，阳性者不应做穿刺。Allen试验方法为：嘱病人握拳，观察两手指尖，同时压迫桡、尺动脉，然后在放松压迫尺动脉的同时，让病人松拳，观察手指的颜色。如5s内手掌由苍白变红，则表明桡动脉侧支循环良好，Allen试脸阴性；如长于5s手掌的颜色仍不变红，提示桡动脉侧支循环不佳，Allen试脸阳性。\n', '', , , , '32.0', '');
