INSERT INTO `table_operatspec` VALUES ('60', '急诊医学', '创伤救护技术', '止血', '', '', , 0x3C702F3E3C65626D73706163652F3EE585A8E8BAABE59084E5A484E79A84E99D9EE6ADA3E5B8B8E680A7E587BAE8A180E38082, '<p/><ebmspace/>出血量对生命影响不大，但若止血，对局部组织压迫较严重且影响功能的。', '', , , '', '60.0', '');
INSERT INTO `table_operatspec` VALUES ('61', '急诊医学', '创伤救护技术', '包扎', '', '', , 0x3C702F3E3C65626D73706163652F3EE5BC80E694BEE680A7E79A84E4BCA4E58FA3EFBC8CE587BAE8A180E8BE83E5A49AEFBC8CE9AAA8E585B3E88A82E68D9FE4BCA4E99C80E59BBAE5AE9AE697B6E38082, '<p/><ebmspace/>较深或感染较重的伤口，若出血不是很多，可以将伤口暴露。', '', , '', '', '61.0', '');
INSERT INTO `table_operatspec` VALUES ('62', '急诊医学', '创伤救护技术', '外伤固定术', '', '', , 0x3C702F3E3C65626D73706163652F3EE59B9BE882A2E79A84E9AAA8E585B3E88A82E68D9FE4BCA4EFBC8CE58C85E68BACE9AAA8E68A98E884B1E4BD8DE38081E7A59EE7BB8FE8A180E7AEA1E68D9FE4BCA4E38081E4B8A5E9878DE79A84E8BDAFE7BB84E7BB87E68CABE8A382E4BCA4EFBC8CE8848AE6A48EE9AAA8E68A98EFBC8CE8848AE9AB93E68D9FE4BCA4E38082, '<p/><ebmspace/>大出血休克，须先止血、输液，维持生命体征稳定后，再行固定。', '', , , '', '62.0', '');
INSERT INTO `table_operatspec` VALUES ('63', '急诊医学', '创伤救护技术', '搬运伤员的技术', '', '', , 0x3C702F3E3C65626D73706163652F3EE98082E59088E4BA8EE789B9E6AE8AE4BCA4E59198E79A84E690ACE8BF90E38082, '<p/><ebmspace/>伤员伤情很重，生命体征很不稳定，搬运工具未准备好。', '', , , '', '63.0', '');
