INSERT INTO `table_operatspec` VALUES ('65', '急诊医学', '急诊诊疗操作技术', '胸膜腔穿刺术', '', '', 0x3C702F3E3C65626D73706163652F3EE883B8E8869CE88594E7A9BFE588BAE69CAFE5B8B8E794A8E4BA8EE6A380E69FA5E883B8E8869CE88594E7A7AFE6B6B2E79A84E680A7E8B4A8E38081E68ABDE6B6B2E5878FE58E8BE68896E9809AE8BF87E7A9BFE588BAE883B8E8869CE88594E58685E7BB99E88DAFE7AD89E38082, , '<p/><font color=\"#4bb033\">1.&nbsp;</font>病情危重，有严重出血倾向，大咯血。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>剧烈咳嗽或者对麻醉药过敏者。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>穿刺部位皮肤有炎症病灶，如可能应更换穿刺部分。\n<p/><ebmspace/>相对禁忌证：病情危重，但需要进行胸膜腔穿刺以明确诊断或缓解症状者。\n', , , , , '65.0', '');
INSERT INTO `table_operatspec` VALUES ('66', '急诊医学', '急诊诊疗操作技术', '腹腔穿刺术', '', '', '', , '<p/><ebmspace/>疑有巨大卵巢囊肿、腹腔内广泛粘连及肝昏迷前期。', , , , '', '66.0', '');
INSERT INTO `table_operatspec` VALUES ('67', '急诊医学', '急诊诊疗操作技术', '心包穿刺术', '', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>心包积液的诊断未明确。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>慢性缩窄性心包炎和风湿性心包炎。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>正在接受抗凝治疗，有出血倾向或者血小板计数低于50×10<sup>9</sup>/L。\n', 0x3C702F3E3C65626D73706163652F3EE794A8E59381E58786E5A487E5908CE883B8E88594E7A9BFE588BAE69CAFE38082, , , , '67.0', 'JZZL67-B1-CZ');
INSERT INTO `table_operatspec` VALUES ('68', '急诊医学', '急诊诊疗操作技术', '洗胃术', '', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>催吐洗胃术 意识障碍者；抽搐、惊厥未控制之前；患者不合作，拒绝饮水者；服腐蚀性毒物及石油制品等急性中毒者；合并有上消化道出血、主动脉瘤、食管静脉曲张等；孕妇及老年人。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>胃管洗胃术药 强酸、强碱及其他对消化道有明显腐蚀作用的毒物中毒；伴有上消化道出血、食管静脉曲张、主动脉瘤、严重心脏疾病等患者；中毒诱发惊厥未控制者；乙醇中毒，因呕吐反射亢进，插胃管时容易发生误吸，所以要慎用胃管洗胃术。\n', , , , '', '68.0', '');
INSERT INTO `table_operatspec` VALUES ('69', '急诊医学', '急诊诊疗操作技术', '导尿术', '', '', , , '<p/><ebmspace/>尿道狭窄、闭塞以及尿道肿物患者。', , , , '', '69.0', '');
INSERT INTO `table_operatspec` VALUES ('70', '急诊医学', '急诊诊疗操作技术', '腰椎穿刺术', '', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>病情危重者。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>脓毒症。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>穿刺部位的皮肤、皮下软组织或脊柱有感染。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>颅内占位性病变特别是有严重颅内压增高或已出现脑疝迹象。\n<p/><font color=\"#4bb033\">5.&nbsp;</font>高颈段脊髓肿物或脊髓外伤的急性期。\n', , , , , '70.0', '');
INSERT INTO `table_operatspec` VALUES ('71', '急诊医学', '急诊诊疗操作技术', '骨髓穿刺术', '', '', , , '<p/><ebmspace/>血友病以及选择穿刺部位存在感染者。', , , , '', '71.0', '');
INSERT INTO `table_operatspec` VALUES ('72', '急诊医学', '急诊诊疗操作技术', '食管三腔两囊管的应用', '', '', '', 0x3C702F3E3C65626D73706163652F3EE794A8E4BA8EE997A8E99D99E88489E9AB98E58E8BE5BC95E8B5B7E79A84E9A39FE7AEA1E38081E88383E5BA95E99D99E88489E69BB2E5BCA0E7A0B4E8A382E587BAE8A180E38082, '', , , , '', '72.0', '');
INSERT INTO `table_operatspec` VALUES ('73', '急诊医学', '急诊诊疗操作技术', '急诊人工心脏起搏术', '', '', , , '', '', , , '', '73.0', 'JZZL73-B1-GS');
INSERT INTO `table_operatspec` VALUES ('74', '急诊医学', '急诊诊疗操作技术', '溶栓治疗', '概述', '', , '', '', '', '', '', '', '74.0', '');
INSERT INTO `table_operatspec` VALUES ('75', '急诊医学', '急诊诊疗操作技术', '溶栓治疗', '溶栓药物', '', , '', '', '', '', '', '', '75.0', '');
INSERT INTO `table_operatspec` VALUES ('76', '急诊医学', '急诊诊疗操作技术', '溶栓治疗', '急性心肌梗死的溶栓治疗', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>既往任何时间发生过出血性脑卒中，1年内发生过缺血性脑卒中或脑血管事件，颅内肿瘤。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>近期(2~4周)活动性内脏出血(月经除外)。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>可疑主动脉夹层。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>入院时严重且未控制的高血压〔>180/110mmHg)或慢性严重高血压病史。\n<p/><font color=\"#4bb033\">5.&nbsp;</font>目前正在使用治疗剂量的抗凝药，已知的出血倾向。\n<p/><font color=\"#4bb033\">6.&nbsp;</font>近期((2~4周)创伤史，包括头部外伤、创伤性心肺复苏或较长时间(>10min)的心肺复苏。\n<p/><font color=\"#4bb033\">7.&nbsp;</font>近期(<3周)外科大手术。\n<p/><font color=\"#4bb033\">8.&nbsp;</font>近期(＜2周)在不能压迫部位的大血管穿刺。\n<p/><font color=\"#4bb033\">9.&nbsp;</font>曾使用链激酶(尤其5d至2年内使用者)或对其过敏的患者，不能重复使用链激酶。\n<p/><font color=\"#4bb033\">10.&nbsp;</font>妊娠。\n<p/><font color=\"#4bb033\">11.&nbsp;</font>活动性消化性溃疡。\n', '', , '', , '76.0', '');
INSERT INTO `table_operatspec` VALUES ('77', '急诊医学', '急诊诊疗操作技术', '溶栓治疗', '急性脑梗死的溶栓治疗', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>目前正应用抗凝药物或凝血酶原时间(PT)国际标准化比率超过1.&nbsp;7。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>发病前48h应用肝素，而部分凝血活酶时间延长。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>血小板计数小于10×109/L。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>发病前3个月出现过卒中或严重脑外伤。\n<p/><font color=\"#4bb033\">5.&nbsp;</font>发病前14d做过大手术。\n<p/><font color=\"#4bb033\">6.&nbsp;</font>治疗前收缩压超过185mmHg或舒张压超过110mmHg。\n<p/><font color=\"#4bb033\">7.&nbsp;</font>神经系统体征迅速改善。\n<p/><font color=\"#4bb033\">8.&nbsp;</font>孤立、轻度的神经功能缺损，如单纯共济失调、感觉障碍、轻度肌无力等。\n<p/><font color=\"#4bb033\">9.&nbsp;</font>既往脑出血史。\n<p/><font color=\"#4bb033\">10.&nbsp;</font>血糖低于2.&nbsp;8mmol/L或高于22.&nbsp;2mmol/L。\n<p/><font color=\"#4bb033\">11.&nbsp;</font>发病时有癫痫发作。\n<p/><font color=\"#4bb033\">12.&nbsp;</font>发病前3周内有胃肠道或泌尿道出血。\n<p/><font color=\"#4bb033\">13.&nbsp;</font>近期心肌梗死。\n', '', '', '', , '77.0', '');
INSERT INTO `table_operatspec` VALUES ('78', '急诊医学', '急诊诊疗操作技术', '溶栓治疗', '大面积肺栓塞的溶栓治疗', '', , , '<p/><font color=\"#4bb033\">1.&nbsp;</font>绝对禁忌证\n<p/>(1)活动性内出血。\n<p/>(2)近期的自发性颅内出血。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>相对禁忌证\n<p/>(1)大手术、分娩、器官活检或不能压迫的血管穿刺史(l0d内)。\n<p/>(2)2个月内缺血性中风。\n<p/>(3)l0d内胃肠道出血。\n<p/>(4)15d内严重外伤。\n<p/>(5)1个月内神经外科或眼科手术。\n<p/>(6)未控制的重度高血压(收缩压＞180mmHg，舒张压＞110mmHg)。\n<p/>(7)近期心肺复苏。\n<p/>(8)妊娠。\n<p/>(9)感染性心内膜炎。\n<p/> (10)糖尿病出血性视网膜病变。\n<p/> (11)肝、肾疾病。\n <p/>(12)出血性疾病。\n', '', , , , '78.0', '');
INSERT INTO `table_operatspec` VALUES ('79', '急诊医学', '急诊诊疗操作技术', '心脏电复律', '', '', , , '<p/><ebmspace/>需紧急心肺复苏者室颤或无脉室速无禁忌证，择期电转复者禁忌证主要有：\n<p/><font color=\"#4bb033\">1.&nbsp;</font>洋地黄中毒或低血钾导致的心律失常。\n<p/><font color=\"#4bb033\">2.&nbsp;</font>病情危急且不稳定，例如严重心功能不全或风湿活动，严重电解质紊乱和酸碱失衡。\n<p/><font color=\"#4bb033\">3.&nbsp;</font>室上性心律失常伴高度或完全性房室传导阻滞，即使转为窦性心律也不能改善血流动力学状态。\n<p/><font color=\"#4bb033\">4.&nbsp;</font>房颤反复发作并且不能耐受长期抗心律失常药物如奎尼丁或胺碘酮者。\n<p/><font color=\"#4bb033\">5.&nbsp;</font>在药物维持下，复律后不能维持又复发的心房颤动或其他心律失常者。\n<p/><font color=\"#4bb033\">6.&nbsp;</font>阵发性心动过速频繁发作者不宜多次反复电复律。\n<p/><font color=\"#4bb033\">7.&nbsp;</font>病态窦房结伴发的快-慢综合征。\n<p/><font color=\"#4bb033\">8.&nbsp;</font>引起心律失常的直接病因如甲亢等未控制者，房颤时间>1年，心脏(尤其左心房)显著扩大，或曾经发生过体循环栓塞者。\n', '', , '', , '79.0', '');
INSERT INTO `table_operatspec` VALUES ('80', '急诊医学', '急诊诊疗操作技术', '呼吸机的临床应用', '', '', , , '<p/><ebmspace/>原则上讲机械通气没有绝对禁忌证，但是在下列情况时机械通气可能使病情加重：气胸以及纵隔气肿未行引流，肺大疱和肺囊肿，低血容量性休克未补充血容量，严重肺出血，气管食管瘘等。但是在出现致命性通气和氧合障碍时，应该在积极处理原发病(如尽快行胸腔闭式引流，积极补充血容量等)，同时不失时机地应用机械通气。', '', , '', , '80.0', 'JZZL80-B1-CZ/JZZL80-B2-CZ/JZZL80-B3-CZ/JZZL80-B4-CZ/JZZL80-B1-BF/JZZL80-B2-BF/JZZL80-B3-BF');
